import { Navbar } from 'react-bootstrap';
import styles from './Navbar.module.scss';

const Nav = () => {
  return (
    <Navbar>
      <ul className="col">
        <li className={styles.logo}>Logo</li>
        <li className="">Search</li>
      </ul>
    </Navbar>
  );
};

export default Nav;
